//import './ContentPage.css';

function Paintings() {
    return (
      <div className="Paintings">
        <header align="left">
          <p>
            In my free time, I enjoy smearing blots of color across canvases. 
            Please direct any painting-related inquiries to my personal email 
            myradotzel[at]gmail[dot]com.
          </p>
        </header>
      </div>
    );
  }
  
  export default Paintings;
